import React from 'react';
import ReactDOM from 'react-dom';

const App = () => (
  <div>
    <p>Hello World</p>
  </div>
)

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
